import React from 'react'

import Post from './Post'

const MapFilteredPosts = ({ filteredData }) => {
    return (
        <div>
            {filteredData.postFilter.filteredPosts.map(({ user: { username }, title, posted, id }) => {
                return (
                    <Post 
                        key={id} 
                        username={username}
                        title={title}
                        posted={posted}
                        id={id}
                    />
                )})}
        </div>
    )
}

export default MapFilteredPosts
